    constructor(prop){
        super(prop)
        this.state.list = [
            {
                key:1,
                icon:'mail',
                content:'VOA慢速英语'
            }
        ]
    }

    render() {
        return (
            <Fragment>
                <img className='app-header-logo' src={logo}/>
                <Menu mode="horizontal" className="app-header-menu">
                    <Menu.Item key="mail">
                        <Icon type="mail" />VOA慢速英语
                    </Menu.Item>
                    <Menu.Item key="mail1">
                        <Icon type="mail" />VOA慢速英语
                    </Menu.Item>
                    <Menu.Item key="mail2">
                        <Icon type="mail" />VOA慢速英语
                    </Menu.Item>
                    <Menu.Item key="mail3">
                        <Icon type="mail" />VOA慢速英语
                    </Menu.Item>
                    <Menu.Item key="mail4">
                        <Icon type="mail" />VOA慢速英语
                    </Menu.Item>
                    <Menu.Item key="mail5">
                        <Icon type="mail" />VOA慢速英语
                    </Menu.Item>
                </Menu>
            </Fragment>
        )

    }
}

export default AppHeader;
